import { Platform } from 'react-native';

const isWeb = () => {
  return (Platform.OS === 'web');
};

const getOS = () => {
  return Platform.OS;
};

const getAppVersion = () => {
  return '0.8.3-beta';
};

export default { isWeb, getOS, getAppVersion };
